import React from 'react';
import { View, Text, Image } from 'react-native';

function Home() {
	return (
		<View style={{ backgroundColor: 'white', flex: 1 }}>
			<Image
				source={{ uri: require('../assets/logo.png') }}
				style={{ width: 120, height: 50, borderWidth: 2, borderColor: 'red' }}
			/>
			<Text>Home</Text>
		</View>
	);
}

export default Home;
